import React from 'react';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Card from 'react-bootstrap/Card';
import { Link } from 'react-router-dom';
import Button from 'react-bootstrap/Button';
import ListGroup from 'react-bootstrap/ListGroup';

const Links = () => {
    return (
        <div className="App">
            <Container fluid>
                <Row>
                    <Col>
                        <h1>Links</h1>
                    </Col>
                </Row>
                <Row>
                    <ListGroup as="ul">
                        <ListGroup.Item as="li" active>
                            Github: <Link to='https://github.com/mateovargas'></Link>
                        </ListGroup.Item>
                        <ListGroup.Item as="li">
                            LinkedIn: <Link to="https://www.linkedin.com/in/mateo-vargas-03896189/"></Link>
                        </ListGroup.Item>
                        <ListGroup.Item as="li" disabled>
                            Twitch: <Link to="https://twitch.tv/matvar55"></Link>
                        </ListGroup.Item>
                        <ListGroup.Item as="li">
                            Youtube: <Link to="https://youtube.com/matvar55"></Link>
                        </ListGroup.Item>
                    </ListGroup>
                </Row>

            </Container>
        </div>
    )
}

export default Links
